export const navLinks = [
  {
    href: "./vehicles",
    label: "VEHICLE",
  },
  {
    href: "./energy",
    label: "ENERGY",
  },
  {
    href: "./charging",
    label: "CHARGING",
    products: [
      {
        cover: Nav_Charging,
        title: "Charging",
        links: [{ label: "Learn", to: "/charging" }],
      },
      {
        cover: Nav_Home_Charging,
        title: "Home Charging",
        links: [
          { label: "Learn", to: "/" },
          { label: "Shop", to: "/" },
        ],
      },
      {
        cover: Nav_Supercharging,
        title: "Supercharging",
        links: [
          { label: "Learn", to: "/" },
          { label: "Find", to: "/" },
        ],
      },
    ],
    links: [
      { label: "Trip Planner", to: "/" },
      { label: "Charging With NACS", to: "/" },
      { label: "Supercharger Voting", to: "/" },
      { label: "Host a Supercharger", to: "/" },
      { label: "Host Wall Connectors", to: "/" },
    ],
  },
  {
    href: "./discover",
    label: "DISCOVER",
    links: [
      {
        title: "Resources",
        links: [
          { label: "Demo Drive", to: "/" },
          { label: "Customer Stories", to: "/" },
          { label: "Events", to: "/" },
        ],
      },
      {
        title: "Location Services",
        links: [
          { label: "Find Us", to: "/" },
          { label: "Trip Planner", to: "/" },
          { label: "Find a Collision Center", to: "/" },
          { label: "Find a Certified Installer", to: "/" },
        ],
      },
      {
        title: "Company",
        links: [
          { label: "About", to: "/" },
          { label: "Careers", to: "/" },
          { label: "Investor Relations", to: "/" },
        ],
      },
    ],
  },
];
